import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Lobby from './components/Lobby/Lobby';
import 'typeface-roboto';
import { BrowserRouter as Router } from 'react-router-dom'

function App() {

  return (
    <Router>
      <div className="App">
        <Lobby/>
      </div>
    </Router>
  );
}

export default App;
